script: |
  super -f tsv -I q9624.sql | sort > q9624.out

vector: true

inputs:
  - name: q9624.sql
    data: |
      SELECT ALL - ( - 5 ) AS col2, - 40 FROM tab1 WHERE NOT + ( + 24 ) = + COALESCE ( - 11, - + col0 ) * col2 + - + col0 * + col1 * + 70 / col1 GROUP BY col1 HAVING NULL IS NULL;
  - name: tab1

outputs:
  - name: q9624.out
    data: |
      5	-40
      5	-40
      5	-40
